import React from 'react';
import './App.css'; // Assuming you have a CSS file for styling
import Dashboard from './d'; // Import the Dashboard component

function App() {
    return (
        <div className="App">
            <header className="App-header">
                <h1>Welcome to the Electricity Monitoring System</h1>
            </header>
            <main>
                <Dashboard />
            </main>
        </div>
    );
}

export default App;
